var course = -1
z.angularUnbind("course")
z.angularBind("course", -1)

z.angularWatch("course", (before, after) => {
    course = after.asInstanceOf[String].toInt;
})

println("%angular <h3>Distribution of events for " + course.toString + "</h3>" + 
        "<p>If nothing is shown, try fixing the settings with keys=events, groups=label, and values=eventRatio. " + 
        "Additionally, you can also display the raw counts with the setting values=count</p>")
if (course == -1) {
    z.show(eventRatios)
} else {
    z.show(eventRatios.where($"course_id" === lit(course)))
}

def minutesBetween(col1: Column, col2: Column) =
  ((col1.cast("timestamp").cast("bigint") - col2.cast("timestamp").cast("bigint")) / 60).cast("int")

val win = Window.partitionBy("enrollment_id").orderBy("time")
var nextAction = trainLogsDF.withColumn("prevAction", lag("time", 1, null).over(win))
var actions = nextAction.withColumn("minutesBetween", minutesBetween(nextAction("time"), nextAction("prevAction"))).na.fill(0)
actions.where($"enrollment_id" === 1).show(10)
